import React, { useState } from "react"
import { Tabs, Tab } from "react-bootstrap"
import { Excel } from "../../components/Excel/Excel"

export const Inicio = () => {
    const [tabs, setTabs] = useState([])
    const [num, setNum] = useState(0)
    const newTab = () => {
        setNum(num+1) 
        setTabs([...tabs, {name: `Tab ${num}`}])
    }

    return <div>
        <button className="btn" onClick={newTab}>aaa</button>
        <Tabs
            defaultActiveKey="home"
            transition={false}
            className="mb-3 m-2"
        >
            {tabs.map(item => <Tab title={item.name} eventKey=""><Excel></Excel></Tab>)}
    
        </Tabs>
    </div>
}
